        console.log(element.titulo)
    });
    return ( 
        <div className="componente">
            <h2>Discos comprados:</h2>
           
           <div className="ContenedorFichas">
                
                {Comprados.map(Comprado => (
                    <div key={Comprado.id} className="FichaDiscoComprado">
                        <h3>{Comprado.titulo}</h3>
                        <p>Pink Floyd</p>



                    </div>
                ))}
            </div>
        </div>
     );
}
 
